import {
    foodItems
} from "./FoodItemActions";

 export const storeFoodItems = (data) => {
    return dispatch => {
        dispatch(foodItems(data));
    };
};

export const clearFoodItems = () => {
    return dispatch => {
        dispatch(foodItems());
    };
};
